import { Alert } from 'antd';
import React from 'react';

interface ITodoItem{
    item: string;
}

const TodoItem = ({item}: ITodoItem) => {
    return (
        <div>
            <Alert type="success" message={<div>{item}</div>} />
        </div>
    );
};

export default TodoItem;
